import CountryView from './CountryView'
import Button from './Button'

const Country = ({ name, filterFunc }) => {
  const buttonText = 'show'
  return (
    <div>
      {name}
      <Button clickFunc={filterFunc(name)} description={buttonText}/>
    </div>
  )
}


export default Country
